import React, { Component } from 'react';

class List extends Component {

  render() {
    return (
      <div id="list-container">
      {
        this.props.filtered.length > 0 ?
        <div>
          this.props.filtered.map(location => {
            <h1>{location.FacilityName}</h1>

          })
        </div>
        :
        <h1>shit</h1>

      }
      </div>
    );
  }

}

export default List;
